// LoginPage.js
import * as React from 'react';
import LoginForm from './LoginForm';

const LoginPage = ({ onLogin, onRegister }) => {
  return (
    <div className="container mt-5">
      <h2>Login</h2>
      <LoginForm onLogin={onLogin} onRegister={onRegister} />
    </div>
  );
};

export default LoginPage;
